&amp;&amp; s !== sex) continue;\n      if (bp == null || isNaN(bp)) continue;\n\n      outAge.push(Math.floor(age));\n      outBP.push(bp);\n      outSex.push(s);\n\n      if (s === \"Male\") outColor.push(\"#1f77b4\");\n      else outColor.push(\"#e377c2\");\n\n      const key = Math.floor(age);\n      sums.set(key, (sums.get(key) || 0) + bp);\n      counts.set(key, (counts.get(key) || 0) + 1);\n    }\n\n    pts_src.data = { Age: outAge, BP: outBP, Sex: outSex, Color: outColor };\n\n    const ages = Array.from(sums.keys()).sort((x,y) =&gt; x-y);\n    const mean = ages.map(a =&gt; sums.get(a) / counts.get(a));\n\n    const smooth = [];\n    for (let i = 0; i &lt; mean.length; i++) {\n      const left = Math.max(0, i - Math.floor(window/2));\n      const right = Math.min(mean.length - 1, i + Math.floor(window/2));\n      let acc = 0;\n      let n = 0;\n      for (let j = left; j &lt;= right; j++) {\n        acc += mean[j];\n        n += 1;\n      }\n      smooth.push(acc / n);\n    }\n\n    line_src.data = { Age: ages, BP: smooth };\n\n    if (sex === \"Male\") trend.glyph.line_color = \"#1f77b4\";\n    else if (sex === \"Female\") trend.glyph.line_color = \"#e377c2\";\n    else trend.glyph.line_color = \"#7f7f7f\";\n\n    plot.title.text = `${meas} vs Age (Sex: ${sex}, window=${window})`;\n    plot.yaxis[0].axis_label = `${meas} (mmHg)`;\n"}}]]]},"title":"Sex","options":["All","Male","Female"],"value":"All"}},{"id":"p1055"}]}},{"type":"object","name":"Row","id":"p1122","attributes":{"children":[{"id":"p1056"},{"id":"p1057"}]}},{"id":"p1067"}]}},{"type":"object","name":"Column","id":"p1198","attributes":{"children":[{"type":"object","name":"Div","id":"p1133","attributes":{"text":"&lt;h3&gt;Visual 3: Glucose Distribution (mg/dL) by Age and Sex&lt;/h3&gt;"}},{"type":"object","name":"Row","id":"p1196","attributes":{"children":[{"type":"object","name":"Select","id":"p1134","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:value",[{"type":"object","n Glucose distribution (Sex: ${sex}, Age: ${a0}-${a1})`;\n      hist_src.change.emit();\n      stats_src.change.emit();\n      return;\n    }\n\n    let minV = values[0];\n    let maxV = values[0];\n    let sum = 0;\n\n    for (let i = 0; i &lt; values.length; i++) {\n      const v = values[i];\n      if (v &lt; minV) minV = v;\n      if (v &gt; maxV) maxV = v;\n      sum += v;\n    }\n\n    if (minV === maxV) {\n      minV = minV - 1;\n      maxV = maxV + 1;\n    }\n\n    const width = (maxV - minV) / bins;\n\n    const left = new Array(bins);\n    const right = new Array(bins);\n    const top = new Array(bins).fill(0);\n\n    for (let b = 0; b &lt; bins; b++) {\n      left[b] = minV + b * width;\n      right[b] = minV + (b + 1) * width;\n    }\n\n    for (let i = 0; i &lt; values.length; i++) {\n      const v = values[i];\n      let idx = Math.floor((v - minV) / width);\n      if (idx &lt; 0) idx = 0;\n      if (idx &gt;= bins) idx = bins - 1;\n      top[idx] += 1;\n    }\n\n    values.sort((x, y) =&gt; x - y);\n    const mean = sum / n;\n\n    let median = 0;\n    if (n % 2 === 1) {\n      median = values[(n - 1) / 2];\n    } else {\n      median = (values[n/2 - 1] + values[n/2]) / 2;\n    }\n\n    let color = \"gray\";\n    if (sex === \"Female\") color = \"hotpink\";\n    if (sex === \"Male\") color = \"dodgerblue\";\n    const fill_color = new Array(top.length).fill(color);\n\n    hist_src.data = { left, right, top, fill_color };\n\n    stats_src.data = {\n      metric: [\"n\", \"mean\", \"median\"],\n      value: [String(n), mean.toFixed(1), median.toFixed(1)]\n    };\n\n    plot.title.text = `Glucose distribution (Sex: ${sex}, Age: ${a0}-${a1}, bins=${bins})`;\n\n    hist_src.change.emit();\n    stats_src.change.emit();\n    "}}]]]},"title":"Sex","options":["All","Male","Female"],"value":"All"}},{"id":"p1136"}]}},{"id":"p1135"},{"type":"object","name":"Row","id":"p1197","attributes":{"children":[{"id":"p1137"},{"type":"object","name":"DataTable","id":"p1189"," },"axis_label":"Smoking status","major_label_policy":{"type":"object","name":"AllLabels","id":"p1230"}}}],"center":[{"type":"object","name":"Grid","id":"p1231","attributes":{"axis":{"id":"p1227"}}},{"type":"object","name":"Grid","id":"p1236","attributes":{"dimension":1,"axis":{"id":"p1232"}}},{"type":"object","name":"Legend","id":"p1296","attributes":{"title":"Sex","items":[{"type":"object","name":"LegendItem","id":"p1297","attributes":{"label":{"type":"field","field":"sex"},"renderers":[{"id":"p1293"}]}}]}}]}}]]},"code":"\n    const data = all_src.data;\n\n    const sex = sex_w.value;\n    const a0 = age_w.value[0];\n    const a1 = age_w.value[1];\n\n    const Age = data[\"Age\"];\n    const Sex = data[\"Sex\"];\n    const Glu = data[\"Glucose\"];\n    const Group = data[\"SmokingGroup\"];\n\n    const gnames = [\"Non-smoker\", \"Smoker\"];\n    const buckets = { \"Non-smoker\": [], \"Smoker\": [] };\n\n    const outG = [];\n    const outY = [];\n    const outS = [];\n\n    for (let i = 0; i &lt; Glu.length; i++) {\n      const age = Age[i];\n      const sx = Sex[i];\n      const y = Glu[i];\n      const g = Group[i];\n\n      if (age == null || y == null || g == null) continue;\n      if (age &lt; a0 || age &gt; a1) continue;\n      if (sex !== \"All\" &amp;&amp; sx !== sex) continue;\n      if (isNaN(y)) continue;\n      if (!(g in buckets)) continue;\n\n      buckets[g].push(y);\n      outG.push(g);\n      outY.push(y);\n      outS.push(sx);\n    }\n\n    pts_src.data = { group: outG, glucose: outY, sex: outS };\n\n    function quantile(sorted, q) {\n      const n = sorted.length;\n      if (n === 0) return NaN;\n      const pos = (n - 1) * q;\n      const base = Math.floor(pos);\n      const rest = pos - base;\n      if (sorted[base + 1] === undefined) return sorted[base];\n      return sorted[base] + rest * (sorted[base + 1] - sorted[base]);\n    }\n\n    const q1 = [];\n    const q2 = [];\n    const q3 = [];\n    const low = [];\n    const high = [];\n\n    const nArr = [];\n    const meanArr = [];\n    const medArr = [];\n\n    for (let k = 0; k &lt; gnames.length; k++) {\n      const g = gnames[k];\n      const vals = buckets[g].slice().sort((a,b) =&gt; a-b);\n      const n = vals.length;\n\n      if (n === 0) {\n        q1.push(NaN); q2.push(NaN); q3.push(NaN); low.push(NaN); high.push(NaN);\n        nArr.push(\"0\"); meanArr.push(\"-\"); medArr.push(\"-\");\n        continue;\n      }\n\n      const Q1 = quantile(vals, 0.25);\n      const Q2 = quantile(vals, 0.50);\n      const Q3 = quantile(vals, 0.75);\n      const IQR = Q3 - Q1;\n\n      let lo = Q1 - 1.5 * IQR;\n      let hi = Q3 + 1.5 * IQR;\n\n      let wlo = vals[0];\n      let whi = vals[vals.length - 1];\n\n      for (let i = 0; i &lt; vals.length; i++) {\n        if (vals[i] &gt;= lo) { wlo = vals[i]; break; }\n      }\n      for (let i = vals.length - 1; i &gt;= 0; i--) {\n        if (vals[i] &lt;= hi) { whi = vals[i]; break; }\n      }\n\n      let sum = 0;\n      for (let i = 0; i &lt; vals.length; i++) sum += vals[i];\n      const mean = sum / n;\n\n      q1.push(Q1); q2.push(Q2); q3.push(Q3); low.push(wlo); high.push(whi);\n\n      nArr.push(String(n));\n      meanArr.push(mean.toFixed(1));\n      medArr.push(Q2.toFixed(1));\n    }\n\n    box_src.data = { group: gnames, q1, q2, q3, low, high };\n    stats_src.data = { group: gnames, n: nArr, mean: meanArr, median: medArr };\n\n    plot.title.text = `Glucose by Smoking Status (Sex: ${sex}, Age: ${a0}-${a1})`;\n\n    pts_src.change.emit();\n    box_src.change.emit();\n    stats_src.change.emit();\n    "}}]]]},"title":"Sex","options":["All","Male","Female"],"value":"All"}}]}},{"id":"p1201"},{"type":"object","name":"Row","id":"p1324","attributes":{"children":[{"id":"p1214"},{"type":"object","name":"DataTable","id":"p1316","attributes":{"width":360,"height":120,"source":{"id":"p1211"},"view":{"type":"object","name":"CDSView","id":"p1320","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p13
